import { useState } from "react";

export function Dialog({ children }) {
  return <div>{children}</div>;
}

export function DialogTrigger({ children, onClick }) {
  return <span onClick={onClick}>{children}</span>;
}

export function DialogContent({ children }) {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center">
      <div className="bg-white p-4 rounded">{children}</div>
    </div>
  );
}

export function DialogHeader({ children }) {
  return <div className="font-bold text-lg mb-2">{children}</div>;
}

export function DialogTitle({ children }) {
  return <h2>{children}</h2>;
}

export function DialogFooter({ children }) {
  return <div className="mt-4">{children}</div>;
}

export function DialogClose({ children, onClick }) {
  return (
    <button onClick={onClick} className="ml-2 text-sm text-gray-500 hover:text-black">
      {children || "Close"}
    </button>
  );
}
